import './Navbar.css';
import { Link, animateScroll as scroll} from 'react-scroll';

function NavBar(){
    return(
        <nav>
            <ul>
                <li className={activeLink === 'home' ? 'nav-item active' : 'nav-item'}><Link to="home" smooth={true} duration={500}>Home</Link></li>
                <li className={activeLink === 'about' ? 'nav-item active' : 'nav-item'}><Link to="about" smooth={true} duration={500}>About</Link></li>
                <li className='nav-item'><Link to="skills" smooth={true} duration={500}>Skills</Link></li>
                <li className='nav-item'><Link to="projects" smooth={true} duration={500}>Projects</Link></li>
                <li className='nav-item'><Link to="home" smooth={true} duration={500}>Contacts</Link></li>
            </ul>
        </nav>
    );
}

export default NavBar
